webpackJsonp([0xd447daf153d9],{834:function(e,t){e.exports={data:{post:{id:"/home/travis/build/benmvp/benmvp.github.io/content/posts/2015-07-20--new-blog/index.md absPath of file >>> MarkdownRemark",html:'<p>Welcome to my newly resurrected blog! The old version of the blog hadn’t been touched since late 2011 and focused on my personal life. This new iteration of the blog should focus primarily on my professional life as a Senior Software Engineer. Right now my concentration is on Web Front-End, but I find all sorts of UIs appealing, so I’m in the early stages of getting into Mobile Application development as well.</p>\n<p>I want to use this blog to share out technical topics that I find interesting and would like to discuss more deeply than what can be said in a 140-character <a href="https://twitter.com/benmvp">tweet</a>. I plan to share code I’ve worked on and highlight technical problems that I’ve solved at work or on the side. I also intend for some blog posts to serve as written versions of talks that I hope to begin giving in the not-so-distant future.</p>\n<p>If all goes well this blog can serve as a resource for those solving every day problems in the realm of web development and hopefully mobile app development as well.</p>\n<p>Enjoy!</p>',fields:{slug:"/new-blog/",prefix:"2015-07-20"},frontmatter:{title:"New Blog!",subTitle:null,cover:null}},author:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:'<p>Ben is a Christian, husband and father of 2 girls, with a dozen years of experience developing user interfaces for the Web. He currently is a Principal Frontend Engineer at Eventbrite on the Frontend Platform team, focused on improving their React-based design system and frontend infrastructure. Ben also enjoys playing basketball, DIY, watching movies, and <a href="https://twitter.com/benmvp">tweeting</a> / <a href="http://www.benmvp.com">blogging</a> about his experiences with new web technologies.</p>'},footnote:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>© Ben Ilegbodu 2018.</li>\n<li>Powered by <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a> using <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">gatsby-starter-personal-blog</a>.</li>\n</ul>'}},pathContext:{slug:"/new-blog/"}}}});
